Ext.ns("Ext.util").Operators={"=":function(B,A){return B==A},"!=":function(B,A){return B!=A},"^=":function(B,A){return B&&B.substr(0,A.length)==A},"$=":function(B,A){return B&&B.substr(B.length-A.length)==A},"*=":function(B,A){return B&&B.indexOf(A)!==-1},"%=":function(B,A){return(B%A)===0},"|=":function(B,A){return B&&(B==A||B.substr(0,A.length+1)==A+"-")},"~=":function(B,A){return B&&(" "+B+" ").indexOf(" "+A+" ")!=-1}};